import {Outlet,Link} from "react-router-dom";
import {Navbar,Container,Nav} from "react-bootstrap";

export default function (){
    return(
        <>
            <Navbar bg="dark" variant="dark">
                <Container>
                    <Navbar.Brand href="/">Basic Shop</Navbar.Brand>
                    <Nav className="me-auto">
                        <Nav.Link href="#home">Home</Nav.Link>
                        <Nav.Link href="#features">Features</Nav.Link>
                        <Nav.Link href="#pricing">Pricing</Nav.Link>
                    </Nav>
                </Container>
            </Navbar>
            <nav>

                <Link to="/">Home</Link>
                ||
                <Link to="/members/new">register</Link>
                ||
                <Link to="/members">registered List</Link>
                ||
                <Link to="/items/new">product</Link>
                ||
                <Link to="/items">product List</Link>
                ||
                <Link to="/order">product order</Link>
                ||
                <Link to="/orders">order List</Link>

                <Outlet />

            </nav>


        </>
    )
}

